import React, { useState } from "react";
import {
  VideoCameraIcon,
  SparklesIcon,
} from "@heroicons/react/outline";
import ReactPlayer from "react-player";
import VideoDropZone from "./videoDropZone.jsx";
import VideoEditor from "./videoEditor.jsx";
import axios from 'axios';

const Process = () => {
  const [videos, setVideos] = useState([]);
  const [selectedVideo, setSelectedVideo] = useState(null);
  const [processedVideo, setProcessedVideo] = useState(null);
  const [isProcessing, setIsProcessing] = useState(false);
  const [errorMessage, setErrorMessage] = useState(null);

  // Inputs for silence detection
  const [noiseLevel, setNoiseLevel] = useState("-40");
  const [silenceDuration, setSilenceDuration] = useState("2");

  // Metadata fields for the video
  const [videoMetadata, setVideoMetadata] = useState({
    videoDuration: null,
    processingTime: null,
    cutsMade: null,
    requestId: null,
    originalFilePath: null,
    editedFilePath: null,
    silenceDetails: [],
    fileSize: null,
    tags: [],
  });

  const handleFilesAdded = (files) => {
    const newVideos = files.map((file) => ({
      file,
      url: URL.createObjectURL(file),
    }));
    setVideos([...videos, ...newVideos]);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!selectedVideo) {
      setErrorMessage("Please select a video file.");
      return;
    }

    const formData = new FormData();
    formData.append("video", selectedVideo);
    formData.append('noiseLevel', noiseLevel);
    formData.append('silenceDuration', silenceDuration);

    setIsProcessing(true);
    setErrorMessage(null);

    try {
      const response = await fetch("http://localhost:5000/api/videos/upload", {
        method: "POST",
        body: formData,
      });

      if (!response.ok) {
        throw new Error("Failed to process the video.");
      }

      const data = await response.json();
      setProcessedVideo(data.editedFilePath); // Store the URL of the processed video
      setVideoMetadata({
        videoDuration: data.videoDuration,
        processingTime: data.processingTime,
        cutsMade: data.cutsMade,
        requestId: data.requestId,
        originalFilePath: data.originalFilePath,
        editedFilePath: data.editedFilePath,
        silenceDetails: data.silenceDetails,
        fileSize: data.fileSize,
        tags: data.tags,
      });
    } catch (error) {
      setErrorMessage('Error processing video: ' + error.message);
    } finally {
      setIsProcessing(false);
    }
  };

  return (
    <div>
      <div className="bg-customBlue">Logo Should Be Here</div>
      <div className="relative flex flex-row items-start space-y-4 p-4">
        <div className="flex bg-zinc-50">
          <div className="flex flex-col items-center space-y-4">
            {[
              { icon: VideoCameraIcon, label: "Video Silence Remover" },
              { icon: SparklesIcon, label: "Effects" },
            ].map(({ icon: Icon, label }, index) => (
              <div key={index} className="flex flex-col items-center space-y-1">
                <Icon className="h-6 w-6 text-gray-500" />
                <span className="text-gray-500">{label}</span>
              </div>
            ))}
          </div>

          <div className="flex flex-col m-2 pl-10 border-l-4 border-white-500">
            <h1 className="text-2xl font-bold mb-4">Video Upload</h1>
            <VideoDropZone onFilesAdded={handleFilesAdded} />

            {videos.length > 0 && (
              <div className="mt-4">
                {selectedVideo && (
                  <div className="mt-4">
                    {selectedVideo instanceof File && (
                      <ReactPlayer url={URL.createObjectURL(selectedVideo)} controls />
                    )}
                    <form onSubmit={handleSubmit} className="mt-4">
                      <input
                        type="number"
                        value={noiseLevel}
                        onChange={(e) => setNoiseLevel(e.target.value)}
                        placeholder="Noise Level"
                        className="block w-full p-2 border border-gray-300 rounded mt-2"
                      />
                      <input
                        type="number"
                        value={silenceDuration}
                        onChange={(e) => setSilenceDuration(e.target.value)}
                        placeholder="Silence Duration"
                        className="block w-full p-2 border border-gray-300 rounded mt-2"
                      />
                      <button
                        type="submit"
                        disabled={isProcessing}
                        className="block w-full p-2 bg-blue-500 text-white rounded mt-4"
                      >
                        {isProcessing ? 'Processing...' : 'Process Video'}
                      </button>
                    </form>
                    {errorMessage && (
                      <div className="mt-4 text-red-500">
                        <p>{errorMessage}</p>
                      </div>
                    )}
                    {processedVideo && (
                      <div className="mt-4">
                        <h2 className="text-xl font-semibold">Processed Video</h2>
                        <video controls src={processedVideo} className="mt-4 w-full" />
                      </div>
                    )}
                  </div>
                )}
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Process;
